import { useNavigate } from 'react-router-dom'
import axios from "axios";

//https://649cf38a9bac4a8e669d1b36.mockapi.io/todolist

const columns = [
  { field: 'fristName', headerName: 'FristName', width: 70 },
  { field: 'lastName', headerName: 'LastName', width: 130 },
  { field: 'age', headerName: 'Age', width: 130 },
  {
    field: 'email',
    headerName: 'email',
    type: 'number',
    width: 90,
  },
  {
    field: 'address',
    headerName: 'address',
    description: 'This column has a value getter and is not sortable.',
    sortable: false,
    width: 160,
    valueGetter: (params) =>
      `${params.row.firstName || ''} ${params.row.lastName || ''}`,
  },
  {
    field: 'id',
    headerName: 'ID',
    type: 'number',
    width: 90,
  }
];

function Home() {

  const navigate = useNavigate()

  const [users, setUsers] = useState()

  useEffect(() => {
    const dataRegister = JSON.parse(localStorage.getItem("dataRegister"))
    if (!dataRegister) {
      navigate('/register')
    }
    const res = axios.get("https://649cf38a9bac4a8e669d1b36.mockapi.io/todolist")
    res.then((data) => setUsers(data.data))
  }, [])

  console.log('============= users', users)

  return (
    <div style={{ height: 400, width: '100%' }}>
      <DataGrid
        rows={users}
        columns={columns}
        initialState={{
          pagination: {
            paginationModel: { page: 0, pageSize: 5 },
          },
        }}
        pageSizeOptions={[5, 10]}
        checkboxSelection
      />
    </div>
  );

